import React from 'react';
import classes from './About.module.css';

export default function About(props) {
    return (
        <div>
            <div>
                <h2>Thank you</h2>
                <p>Thank you very much for checking out my app and for your interest to learn more about it. I appreciate that!</p>
            </div>
            <div className={classes.Container}>
                <div className={classes.Card}>Hello, it´s me!</div>
                <div className={classes.Card}>That´s my tech stack</div>
                <div className={classes.Card}>How I build this app?</div>
                <div className={classes.Card}>What was my biggest challenge?</div>
                <div className={classes.Card}>What is my biggest learning?</div>
                <div className={classes.Card}>How to reach me</div>
            </div>
            <div
                onClick={props.onCloseAbout}>Return to starting page</div>
            <div>Return to your game of memory</div>
        </div>
    )
};
